package HackerRank;

import org.junit.Test;
import static org.junit.Assert.*;
import java.io.*;

public class SubstringDiffTest {
    private final ByteArrayOutputStream out = new ByteArrayOutputStream();

    private void simulate(String input) {
        System.setIn(new ByteArrayInputStream(input.getBytes()));
        System.setOut(new PrintStream(out));
    }

    @Test
    public void main() throws Exception {
        String input = "3\n" +
                "2 tabriz torino\n" +
                "0 abacba abcaba\n" +
                "3 helloworld yellomarin";

        String expected = "4\n" +
                "3\n" +
                "8\n";

        simulate(input);
        SubstringDiff.main(null);

        assertEquals(expected, out.toString());
    }

    @Test(timeout = 2000)
    public void main2() throws Exception {
        String input = "10\n" +
                "11  \n" +
                "5  \n" +
                "959  \n" +
                "19  \n" +
                "10  \n" +
                "1117  \n" +
                "31  \n" +
                "7  \n" +
                "7  \n" +
                "520  ";

        String expected = "256\n" +
                "13\n" +
                "1500\n" +
                "429\n" +
                "752\n" +
                "1191\n" +
                "40\n" +
                "13\n" +
                "195\n" +
                "1500\n";

        simulate(input);
        SubstringDiff.main(null);

        assertEquals(expected, out.toString());
    }
}
